import React from 'react';
import styled from 'styled-components';
// import app_screen_4 from '../images/app_screen_4.png';

const StyledSlideOne = styled.div`
  .background-top {
    background: #FAC943;
    width: 100%;
    height: 80vh;
  }
  .background-bottom {
    background: #FFFFFF;
    width: 100%;
    height: 20vh;
  }
`;

function SlideOne() {
  return (
    <StyledSlideOne>
      <div className='background-top'/>
      <div className='background-bottom' />
      <img src={app_screen_4} className="App-logo" alt="logo" />
    </StyledSlideOne>
  );
}

export default SlideOne;
